import "./dashboard.css";
import Sidebar from "./sidebar";

function dashboard() {
  return (
    <div>
      <div>
        <h1>Dashboard Administrador</h1>
      </div>
      <div className="grid-cols-3 bg-orange-400"></div>
    </div>
  );
}

export default dashboard;
